descr:
Fica a pessoa jurídica notificada sobre a entrega dos laudos de análise de produtos coletados neste estabelecimento:
1. laudo de análise 451.1P.0/2023 do produto "café torrado e moído, Capira", lote 09/03/2023 com parecer satisfatório;
2. laudo de análise 452.1P.0/2023 do produto "fubá, Sinhá", lote 0263A23IT com parecer insatisfatório para rotulagem.
